import React,{useEffect} from 'react'
import './list.css'

import Note from './Note'
const List = ({array_data,setData,}) => {

   // fetching memo from localStorage

   useEffect(()=>{
    const fetch = JSON.parse(localStorage.getItem('memo_app'))
    setData(fetch)
  },[])
  

  
 




  return (

    <div className='list_css'>
     {
      array_data.map((element)=> <Note
      key={element.id}
      data={element}
      setData={setData}
      del_mem={Delete}
      />)
     }




    </div>
  )
}

export default List
